        return(
            <div className="sidebar">
                <ul className="thread-list">
                    <label>Messages</label>
                    <li>
                        <Link to="/thread">
                            <i className="zmbi zmbi-account-circle" />
                            <h5>Name</h5>
                            <p>This is the last message</p>
                        </Link>
                    </li>
                </ul>
            </div>
        );
    }
}

